import './Playlists.css'

function Playlists({image, title, id}) {
    return (
        <div className="playLists">
            <div className="playLists__info">
                {console.log(image.url)}
                {image.url ? <img src={`${image.url}`} width="640" height="640" alt="" /> : <img src="https://www.salonlfc.com/wp-content/uploads/2018/01/image-not-found-1-scaled-1150x647.png" width="640" height="640" alt="" />}
                <h1>{title}</h1>
                <p>id = {id}</p>
            </div>
        </div>
    )
}

export default Playlists
